import React from "react";
import { Card } from "antd";
import ageChecker from '../../Assets/Images/agechecker.jpg'


const Cards = () => {
  const cardData = [
    {
      title: "App Login Page",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },
    {
      title: "FakeStore Api Products Card",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },
    {
      title: "Age Calculator",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },
    {
      title: "Age Calculator",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },
    {
      title: "Age Calculator",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },
    {
      title: "Age Calculator",
      content: <a href="https://age-calculator-livid.vercel.app/" target="_blank">< img src = {ageChecker} className = ""/></a>,
    },

  ];

  return (
    <div className="flex items-center flex-wrap justify-around">
      {cardData.map((item, index) => (
        <Card
          key={index} 
          title = {item.title}     
          className="w-[300px] h-[290px] mb-[50px] shadow-md text-center"
        >
          <div>{item.content}</div>
        </Card>
      ))}
    </div>
  );
};

export default Cards;
